function getAllTextFromMessage(msg) {
    if (!msg || !msg.payload || !Array.isArray(msg.payload.output)) return null;
    const message = msg.payload.output.find(o => o.type === "message");
    if (!message || !Array.isArray(message.content)) return null;
    // Concatenate all text chunks in order
    const text = message.content
        .filter(c => c.type === "output_text" || c.type === "text") // cover both shapes
        .map(c => c.text || "")
        .join("");
    return text || null;
}

function stripMarkdownFences(s) {
    if (!s) return s;
    // remove leading and trailing code fences like ```json ... ```
    return s.replace(/^```(?:json)?\s*/i, "").replace(/```$/i, "").trim();
}

// Finds the first balanced {...} block and tries to JSON.parse it.
function extractBalancedJSON(s) {
    if (!s) return null;
    // Some models prepend prose; locate the first '{' and then walk to the matching '}'.
    const start = s.indexOf("{");
    if (start === -1) return null;

    let depth = 0;
    let inString = false;
    let escapeNext = false;

    for (let i = start; i < s.length; i++) {
        const ch = s[i];

        if (escapeNext) {
            escapeNext = false;
            continue;
        }

        if (inString) {
            if (ch === "\\") escapeNext = true;
            else if (ch === "\"") inString = false;
            continue;
        }

        if (ch === "\"") {
            inString = true;
        } else if (ch === "{") {
            depth++;
        } else if (ch === "}") {
            depth--;
            if (depth === 0) {
                const candidate = s.slice(start, i + 1);
                try {
                    return JSON.parse(candidate);
                } catch (e) {
                    // keep scanning in case there is another balanced block later
                }
            }
        }
    }
    return null; // no parsable balanced object found
}

