(function main() {
    const rawText = getAllTextFromMessage(msg);
    if (!rawText) {
        msg.payload = { error: "No text found in response." };
        return;
    }

    // 1) strip code fences
    const unfenced = stripMarkdownFences(rawText);

    // 2) try to extract/parse JSON
    let parsed = null;
    try { parsed = JSON.parse(unfenced); } catch (e) { /* fallthrough */ }
