function checkPemPrivate(ascii){
    const re = /-----BEGIN ([A-Z0-9 ]+)-----([\s\S]*?)-----END \1-----/g;
    let m;
    while ((m = re.exec(ascii)) !== null) {
        const label = m[1].trim();
        const inner = Buffer.from(base64Clean(m[2]), 'base64');

        if (label === 'RSA PRIVATE KEY') return {ok:true, how:'PEM PKCS#1'};
        if (label === 'PRIVATE KEY') {
            if (containsSubarray(inner, RSA_OID)) return {ok:true, how:'PEM PKCS#8 with rsaEncryption'};
            return {ok:false, reason:'It is a PRIVATE KEY but no RSA OID was found'};
        }
        if (label === 'OPENSSH PRIVATE KEY') return {ok:false, reason:'OpenSSH private key'};
    }
    return {ok:false, reason:'No valid PEM block was found'};
}

