// Normalize PEM chains and compare
function extractBlocks(pem){
  if (typeof pem !== 'string') return [];
  const txt = pem.replace(/\r\n/g,'\n');
  const re = /-----BEGIN CERTIFICATE-----[\s\S]*?-----END CERTIFICATE-----/g;
  return txt.match(re) || [];
}
function toCanonicalBlock(block){
  const b64 = block
    .replace(/-----BEGIN CERTIFICATE-----/g,'')
    .replace(/-----END CERTIFICATE-----/g,'')
    .replace(/[^A-Za-z0-9+/=]/g,'');
  let canonB64;
  try { canonB64 = Buffer.from(b64, 'base64').toString('base64'); }
  catch(e){ canonB64 = b64; }
  const lines = [];
  for (let i=0;i<canonB64.length;i+=64) lines.push(canonB64.slice(i,i+64));
  return '-----BEGIN CERTIFICATE-----\n' + lines.join('\n') + '\n-----END CERTIFICATE-----';
}
function canonicalizeChain(pem){
  return extractBlocks(pem).map(toCanonicalBlock).join('\n');
}

